import axios from "axios";
import { createApp, ref } from "vue";

export default function backend(url) {
  const apiUrl = 'http://localhost:8000/api/';
  const apiData = ref();
  const app = createApp({});

  const apiCall = async () => {
    const response = await fetch(apiUrl+"calendar/week")
      .then(res => res.json()).then(resJson => {
      app.provide('apiData', resJson);
    });
  }
  apiCall();
  console.log(apiData.value); // Doesnt work

  return {
    apiData
  }
}
